insert  into `shop_news`(`id`,`title`,`alias`,`info`,`content`,`image`,`status`,`create_date`,`update_date`,`type_news`) values (1,'Cam kt li ch khi mua online','Cam-ket-loi-ich-khi-mua-online','Mua - bn hng qua mng - hnh thc thng mi mi xut hin  Vit Nam nhng nhanh chng pht trin, li ko c nhiu khch hng tin dng. Mua hng qua mng c nhiu im u vit so vi cch mua- bn trc tip ','<h2>Nim tin &amp; Dch v chm s&oacute;c kh&aacute;ch h&agrave;ng tuyt vi</h2>\r\n<p>Ch&uacute;ng t&ocirc;i tin rng:</p>\r\n<ul class=\"list\">\r\n<li>Mi ngi lu&ocirc;n mun hp t&aacute;c vi ngi m&agrave; h tin tng.</li>\r\n<li>Mi ngi lu&ocirc;n mun hp t&aacute;c vi ngi c&oacute; hiu bit, l&agrave;m vic hiu qu v&agrave; lu&ocirc;n thc hin nhng g&igrave; &atilde; ha.</li>\r\n</ul>\r\n<p>Ti&nbsp;Ca h&agrave;ng <strong>V m&acirc;m xe n&acirc;ng Ngc Thanh</strong>, kh&aacute;ch h&agrave;ng v&agrave; nim tin ca kh&aacute;ch h&agrave;ng l&agrave; iu ch&uacute;ng t&ocirc;i lu&ocirc;n t&acirc;m nim. shop cam kt b&aacute;n h&agrave;ng 100% ch&iacute;nh h&atilde;ng,&uacute;ng nh th&ocirc;ng tin sn phm, v&agrave; s&nbsp;ho&agrave;n tr gp &ocirc;i&nbsp;cho bn nu sn phm kh&ocirc;ng phi ch&iacute;nh h&atilde;ng.  mang li s h&agrave;i l&ograve;ng v&agrave; thoi m&aacute;i cho kh&aacute;ch h&agrave;ng, ch&uacute;ng t&ocirc;i c&oacute;&nbsp;ch&iacute;nh s&aacute;ch i tr h&agrave;ng trong 2 ng&agrave;y: kh&aacute;ch h&agrave;ng c&oacute; th i tr bt k sn phm n&agrave;o &atilde; mua  shop trong v&ograve;ng 2 ng&agrave;y. Nu bn cn tr gi&uacute;p  nhn dng h&agrave;ng tht gi, xin li&ecirc;n h vi ch&uacute;ng t&ocirc;i .</p>\r\n<h2>Thun tin</h2>\r\n<p><em>&ldquo;T&ocirc;i th&iacute;ch vic c&oacute; th ngi ti nh&agrave;, mc b  ng ca m&igrave;nh, bt chp b&ecirc;n ngo&agrave;i tri ang nng n&oacute;ng hay ma gi&oacute;, t&ocirc;i c&oacute; th mua sm bt k l&uacute;c n&agrave;o t&ocirc;i mun. T&ocirc;i thy th gi&atilde;n khi mua sm, nhng t&ocirc;i gh&eacute;t s hi h ca &aacute;m &ocirc;ng v&agrave; s n &agrave;o&rdquo;</em>&nbsp;&ndash; Ch&nbsp;Nguyn Thu Thy&nbsp;&ndash; Doanh nh&acirc;n, chia s.</p>\r\n<p>S thut tin l&agrave; 1 li &iacute;ch tuy&ecirc;t vi khi mua sm trc tuyn tiCa h&agrave;ng V m&acirc;m xe n&acirc;ng Ngc Thanh. Mua sm trc tuyn rt n gin: bn ch cn ngi trc m&aacute;y t&iacute;nh, v&agrave;i c&uacute; click chut, la chn sn phm bn th&iacute;ch trong rt nhiu sn phm. Sau &oacute; sn phm s c giao trc tip n tn nh&agrave; bn.</p>\r\n<p>Nu bn cn mua qu&agrave; cho mt ngi bn ti tnh th&agrave;nh kh&aacute;c, bn kh&ocirc;ng cn lo lng, ch&uacute;ng t&ocirc;i s g&oacute;i qu&agrave; v&agrave; vn chuyn sn phm n ngi bn ca bn nhanh ch&oacute;ng .</p>\r\n<h2>S la chn a dng</h2>\r\n<p>Ti&nbsp;Ca h&agrave;ng <strong>V m&acirc;m xe n&acirc;ng Ngc Thanh</strong>, ch&uacute;ng t&ocirc;i tp trung v&agrave;o nhng sn phm c nht:</p>\r\n<ul class=\"list\">\r\n<li><strong>C NHT</strong>: 80% nhng sn phm ti&nbsp;Ca h&agrave;ng <strong>V m&acirc;m xe n&acirc;ng Ngc Thanh</strong> bn kh&ocirc;ng th t&igrave;m thy ni n&agrave;o kh&aacute;c  Vit Nam.</li>\r\n<li><strong>GI&Aacute; HP L&Yacute;</strong>: . Nu bn t&igrave;m thy trung t&acirc;m thng mi n&agrave;o b&aacute;n gi&aacute; thp hn&nbsp;Ca h&agrave;ng <strong>V m&acirc;m xe n&acirc;ng Ngc Thanh</strong>, ch&uacute;ng t&ocirc;i s chp nhn b&aacute;n cho bn thp hn 5% so vi gi&aacute;  shop kh&aacute;c.</li>\r\n</ul>\r\n<p>Hn na,&nbsp;Ca h&agrave;ng <strong>V m&acirc;m xe n&acirc;ng Ngc Thanh</strong> c&ograve;n c&oacute; th nhn t h&agrave;ng v&agrave; chuyn h&agrave;ng n tnh th&agrave;nh kh&aacute;c.</p>','2013_10_11_17_54_59-vomamxenang-Loi-ich-khi-mua-online-1.jpg,2013_10_11_17_54_59-vomamxenang-Loi-ich-khi-mua-online-2.jpg','1',1371979450,1381489245,'1'),(2,'Giao nhn hng ho xut nhp khu','Giao-nhan-hang-hoa-xuat-nhap-khau','DACO Logistics c php ca hi quan thay mt ch hng ng tn trn t khai, thc hin th tc khai bo hi quan, np thu, giao nhn v vn chuyn hng ha xut nhp khu gip khch hng n gin ha trong cc th tc chng t phc tp khi khai bo hi quan v giao nhn hng ha xut nhp khu.','<p><strong>Dch v ca ch&uacute;ng t&ocirc;i bao gm:</strong></p>\r\n<p>&bull;&nbsp;&nbsp;&nbsp; Lp t khai v&agrave; ho&agrave;n th&agrave;nh th tc khai b&aacute;o hi quan.<br />&bull;&nbsp;&nbsp;&nbsp; Ho&agrave;n th&agrave;nh c&aacute;c th tc ti cng v&agrave; giao h&agrave;ng/nhn h&agrave;ng.<br />&bull;&nbsp;&nbsp;&nbsp; Gii quyt c&aacute;c vn  ph&aacute;t sinh. (Nu c&oacute;)<br />&bull;&nbsp;&nbsp;&nbsp; &oacute;ng h&agrave;ng/r&uacute;t h&agrave;ng ti cng.<br />&bull;&nbsp;&nbsp;&nbsp; Giao nhn h&agrave;ng h&oacute;a xut nhp khu t cng hoc s&acirc;n bay n kh&aacute;ch h&agrave;ng v&agrave; ngc li.<br />&bull;&nbsp;&nbsp;&nbsp; Giao nhn h&agrave;ng h&oacute;a qua trung t&acirc;m ph&acirc;n phi.</p>\r\n<p><span>&ldquo;Kinh nghim nhiu nm trong c&ocirc;ng t&aacute;c khai b&aacute;o hi quan gi&uacute;p ch&uacute;ng t&ocirc;i gii quyt nhiu vn  ph&aacute;t sinh trong khai b&aacute;o bng c&aacute;ch thay mt ch h&agrave;ng k&yacute; t&ecirc;n v&agrave; &oacute;ng du tr&ecirc;n t khai hi quan, th hin c tr&aacute;ch nhim ca ngi khai b&aacute;o hi quan&rdquo;.</span><br /><strong>Mr. B&ugrave;i o&agrave;n Ngc Tun, Customs Broker Department.</strong></p>\r\n<p><span><strong> c t vn v dch v, vui l&ograve;ng li&ecirc;n h:</strong></span></p>\r\n<p><strong>Mr. <strong>B&ugrave;i o&agrave;n Ngc Tun</strong>&nbsp;(Gilla)</strong></p>\r\n<p>Phone: 09.777.5.7.9.11</p>\r\n<p>Email: <a href=\"mailto:tuan.buidoanngoc@gmail.com\">tuan.buidoanngoc@gmail.com</a></p>\r\n<p>Yahoo: <a href=\"mailto:ngoctuan3010842003@yahoo.com\">ngoctuan3010842003@yahoo.com</a></p>\r\n<p>Skype: dev_tuan</p>','','1',1381312731,1381312854,'1');

